import React, { useState, useEffect } from "react";
import { Link, Routes, Route } from "react-router-dom";
import { Toaster } from "react-hot-toast";
import Header from "./components/Header";
import Sidebar from "./components/Sidebar";
import Footer from "./components/Footer";
import Login from "./components/Login";
import ProjectDetail from "./components/ProjectDetail";
import ContactUs from "./components/ContactUs";
import Task from "./components/Task";
import ProjectManagementUses from "./components/ProjectManagementUses";

const API_BASE_URL = "http://localhost:9004/api";

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [projects, setProjects] = useState([]);
  const [backendStatus, setBackendStatus] = useState("Checking...");

  // ‚úÖ Fetch projects from backend
  const fetchProjects = async () => {
    try {
      const response = await fetch(`${API_BASE_URL}/projects`);
      if (!response.ok) throw new Error(`Failed to fetch projects: ${response.status}`);
      
      const data = await response.json();
      console.log("üì• Projects Fetched from Backend:", data);
      setProjects(data); // ‚úÖ Update state
    } catch (error) {
      console.error("‚ùå Error fetching projects:", error);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  // ‚úÖ Check backend connection
  useEffect(() => {
    fetch(`${API_BASE_URL}/test`)
      .then((response) => response.json())
      .then((data) => {
        setBackendStatus(data.message ? `‚úÖ Backend Connected: ${data.message}` : "‚ùå Backend Response Missing 'message' Key");
      })
      .catch((error) => {
        console.error("‚ùå Backend connection failed:", error);
        setBackendStatus(`‚ùå Backend Not Connected: ${error.message}`);
      });
  }, []);

  // ‚úÖ Function to add a project
  const addProject = async (newProject) => {
    try {
      const response = await fetch(`${API_BASE_URL}/project`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(newProject),
      });

      if (!response.ok) throw new Error(`Failed to add project: ${response.status}`);

      const savedProject = await response.json();
      console.log("‚úÖ Project Added:", savedProject);

      setProjects((prevProjects) => [...prevProjects, savedProject]); // ‚úÖ Update state
    } catch (error) {
      console.error("‚ùå Error adding project:", error);
    }
  };

  // ‚úÖ Function to delete a project
  const deleteProject = async (projectId) => {
    try {
      const response = await fetch(`${API_BASE_URL}/project/${projectId}`, {
        method: "DELETE",
      });

      if (!response.ok) throw new Error(`Failed to delete project: ${response.status}`);

      console.log("‚úÖ Project Deleted Successfully");
      setProjects((prevProjects) => prevProjects.filter((project) => project._id !== projectId)); // ‚úÖ Remove from state
    } catch (error) {
      console.error("‚ùå Error deleting project:", error);
    }
  };

  return (
    <div className="flex flex-col min-h-screen">
      <Header isAuthenticated={isAuthenticated} onLogout={() => setIsAuthenticated(false)} showLoginButton={!isAuthenticated} />
      
      <div className="flex flex-1">
        <Sidebar projects={projects} onAddProject={addProject} onDeleteProject={deleteProject} />

        <div className="flex-1 p-6">
          <Toaster position="top-right" gutter={8} />

          <div className="p-4 bg-gray-100 text-center text-lg font-semibold">
            {backendStatus}
          </div>

          <Routes>
            <Route path="/project/:projectId" element={isAuthenticated ? <ProjectDetail projects={projects} /> : <Login onLogin={() => setIsAuthenticated(true)} />} />
            <Route path="/" element={isAuthenticated ? <Task /> : (
                <div className="text-center">
                  <h2 className="text-2xl font-semibold mb-4">Welcome to Project Manager</h2>
                  <p className="mb-6 text-gray-600">Get started by managing your projects here.</p>
                  <div className="mt-6">
                    <Link to="/project-management-uses" className="text-blue-400 hover:text-blue-600">Learn About Project Management Uses</Link>
                  </div>
                </div>
              )}
            />
            <Route path="/contact-us" element={<ContactUs />} />
            <Route path="/project-management-uses" element={<ProjectManagementUses />} />
          </Routes>
        </div>
      </div>

      <Footer />
    </div>
  );
}

export default App;
